职位描述：

1、三年以上工作经验，其中两年以上web开发经验;
2、熟练使用CSS,HTML以及javascript、Ajax、Jquery任何一种或几种技术;
3、熟练使用Spring，SpringMvc，Hibernate，Struts，Mybatis等开发框架;
4、熟练使用Tomcat，jetty等应用服务器;
5、熟练使用Oracle、Mysql、Mongodb、redis等两种以上数据库;
6、有springboot，springcloud等分布式微服务开发经验优先；
7、有良好的职业操守，沟通能力、责任心和团队协作强。

职位描述：

职位描述：
1. 需求分析，文档编写;
Conduct requirement analysis based on the input documentation, communicate with client to solve doubts and prepare low level design documentation;
2. 代码，测试和Review相关工作;
Conduct coding, testing and review work;
3. 指导和帮助境外合作伙伴技术开发并解决技术问题;
Support/Coach Overseas partner and help solve technical issues during development;

职位要求：
1. 有3到5年Java开发经验;
3~5 years of Java coding experience;
2. 熟练掌握Web Service相关知识并拥有基于SOAP&WSDL开发的项目经验;
Strong knowledge of Web Service with working experience of SOAP&WSDL based web service development;
3. 熟练使用Maven, SVN;
Skilled at using Maven, SVN;
4. 良好的英语沟通和读写能力
Good communication and documentation skills in English;
5. 良好的工作态度，对技术比较有热情，愿意学习和使用新的技术或产品;
Good working attitude; Have a passion for Java development and be willing to learn and using new technologies or products;

职位描述：


岗位职责
1.负责AGV调度系统前后端的软件开发升级与维护;
2.负责Web服务器的维护、修改和升级工作。

岗位要求
1.本科以上学历，2年以上Java开发经验;
2.深入理解面向对象程序设计，熟悉常用设计模式;
3.熟悉javaSE/javaEE程序开发，熟悉Socket编程;
4.熟练使用jQuery，熟悉流行的开源框架，如Spring，iBatis/Mybatis等;
5.熟悉通信和线程，了解IO输入输出；
6.熟悉MYSQL数据库开发，配置、维护，熟悉Tomcat服务器的使用及常用的配置。

职位描述：

【职位要求】
1、计算机或相关专业本科以上学历，三年以上的开发经验;
2、精通JAVA语言，了解并使用常见的设计模式，能够完成较复杂的交互流程设计和实现，熟悉linux系统和脚本编程;
3、熟练应用Spring、MyBatis等主流JAVA框架，并了解原理;
4、熟悉JVM原理并能进行调优;
5、熟悉HTTP通信原理，掌握RESTful
Web?Services编程;
6、熟悉HTML、Javascript代码编写;
7、精通MySQL数据库应用系统设计及优化，熟悉存储过程及存储引擎；
8、熟悉大容量数据存储和检索系统设计能力：数据库分区、NoSQL、搜索引擎等;
9、优秀的分析问题和解决问题的能力，对解决具有挑战性问题充满激情;
10、较强的沟通能力和逻辑表达能力，具备良好的团队合作精神和主动意识

