1.3年以上 Java 开发经验，熟练使用Eclipse或MyEclipse等开发工具;
2.熟悉常见设计模式，精通 Springboot，SpringMVC、myBatis等流行开源框架等;3.精通 Java 及面向对象设计开发，对部分 Java 技术有深入研究;
